function displaySchoolValue(schoolName) {
  client.get(schoolName, (err, reply) => {
    if (err) {
      console.error(err);
    } else {
      console.log(reply);
    }
  });
}

// Appels de fonctions pour tester les opérations Redis
displaySchoolValue('Holberton');
